oxy_webhelp_navlinks = {"introduction-d721e309":{"topics":[{"title":"Purpose of the Manual","shortdesc":"<p class=\"shortdesc\">This user manual is designed to provide detailed instructions on how to safely and efficiently use the new-gen EV-Charger from our company. It includes information on installation, operation, maintenance, safety, and troubleshooting.<\/p>","href":"topics\/purpose_of_the_manual_2.html","attributes":{"data-id":"purpose-of-the-manual"},"menu":{"hasChildren":false},"tocID":"purpose-of-the-manual-d721e320","topics":[]},{"title":"Overview of the EV-Charger","shortdesc":"<p class=\"shortdesc\">The new-gen EV-Charger is an advanced charging system designed to work with most electric vehicles. It features a sleek design, sturdy construction, and a range of advanced features that make it easy to use and highly efficient.<\/p>","href":"topics\/overview_of_the_ev-charger_2.html","attributes":{"data-id":"overview-of-the-ev-charger"},"menu":{"hasChildren":false},"tocID":"overview-of-the-ev-charger-d721e331","topics":[]},{"title":"Safety Information","shortdesc":"<p class=\"shortdesc\">Safety is our top priority, and we have included detailed safety information throughout this manual. Please read this information carefully before using the EV-Charger.<\/p>","href":"topics\/safety_information_2.html","attributes":{"data-id":"safety-information"},"menu":{"hasChildren":false},"tocID":"safety-information-d721e342","topics":[]}]}};